import React from 'react';

const History: React.FC = () => {
    return(
        <fieldset>
            <div className="field">
                <h1><br/>Conheça um pouco de nossa história.</h1>
                <h4><br/><br/>Tudo começou em 1867</h4>
                <h5><br/>Nossa loja foi fundada pelo renomado bruxo Godrico Grifinoria. Naquela época fomos a quinta loja fundada no beco vertical, haviam muitos ladrões e feiticeiros das trevas por lá.<br/></h5>
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuSIQvGWhaPeImZJ7wzsQyZXPnNVW2_RsQtA&usqp=CAU" alt="Old Shop"/>
                <h4><br/><br/>Em 1935 tivemos uma nova fachada</h4>
                <h5><br/>Nossa fachada foi preservada até hoje, dês de a reforma de 1935.</h5>
                <img src="https://img.estadao.com.br/thumbs/550/resources/jpg/6/4/1606396766946.jpg" alt="New facade"/>
            </div>
        </fieldset>
    );
}

export default History;
